import React from 'react';

const Menu = () => {
  return (
    <nav
      style={{
        width: '100%',
        maxWidth: '1440px',
        height: '130px',
        background: '#FFF',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 70px',
        boxSizing: 'border-box',
        margin: '0 auto',
      }}
    >
      {/* Left: Logo */}
      <div
        style={{
          width: '100px',
          height: '100px',
          border: '1px solid #CF3733',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          background: '#FFF',
          borderRadius: '50%',
        }}
      >
        <img
          src="/logo.png" // Place your logo image as public/logo.png
          alt="Booktranspo Logo"
          style={{ width: '90px', height: '90px', objectFit: 'contain', borderRadius: '50%' }}
        />
      </div>
      {/* Center and Right: Placeholders for now */}
      <div style={{ flex: 1 }} />
      <div style={{ width: '100px' }} />
    </nav>
  );
};

export default Menu;
